import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faStore, faTruck, faPeopleGroup, faBoxesStacked, faCity, faDolly, faList, faPhone, faHandHoldingDollar, faTruckRampBox, faPrint } from '@fortawesome/free-solid-svg-icons';

const icones = [
  { ícone: faStore, rótulo: 'Cadastro de Fornecedores' },
  { ícone: faTruck, rótulo: 'Cadastro de Vendedores' },
  { ícone: faPeopleGroup, rótulo: 'Cadastro de Clientes' }, // Presumindo erro de digitação no código original
  { ícone: faBoxesStacked, rótulo: 'Cadastro de Vendas' },
  { ícone: faCity, rótulo: 'Cadastro de Cidades' },
  { ícone: faDolly, rótulo: 'Cadastro de Produtos' },
  { ícone: faList, rótulo: 'Cadastro de Categorias' },
  { ícone: faPhone, rótulo: 'Cadastro de Telefones' },
  { ícone: faHandHoldingDollar, rótulo: 'Cadastro de Contas' },
  { ícone: faTruckRampBox, rótulo: 'Cadastro de Movimentação' },
  { ícone: faPrint, rótulo: 'Relatórios' },
];

const MySwiper = () => {
  return (
    <Swiper className="bg-emerald-600">
      {icones.map((item) => (
        <SwiperSlide key={item.rótulo} className="bg-emerald-700">
          <div className="flex flex-col gap-0.5">
            <FontAwesomeIcon ícone={item.ícone} className="h-20" />
            <label className="text-white font-bold">{item.rótulo}</label>
          </div>
        </SwiperSlide>
      ))}
    </Swiper>
  );
};
